import React from 'react';
import Tilt from 'react-tilt';
import food from './food.png';
import './Logo.css';

const Logo = () => {
	return (
		<div className='debug-grid flex ma4 mt0 pa2' style={{ justifyContent: 'flex-end'}}>
		<h1> Tomatoe </h1>
			<Tilt className="debug-gridTilt br2 shadow-2" options={{ max : 55 }} style={{ height: 150, width: 150 }} >
 				<div className="pl2 Tilt-inner pa3"> 
 					<img style={{ paddingTop:'5px' }} alt='logo' src={food} /> 
 					<a> Tomatoe </a>
 				</div>
			</Tilt>
		</div>
	);
}

export default Logo;
